import React from "react";
import { Routes, Route, Link } from "react-router-dom";
import NasaFlowShop from "./NasaFlowShop";
import CartPage from "./CartPage";
import { useCart } from "./CartContext";
import SuccessPage from "./SuccessPage";
import AdminPage from "./AdminPage";
import AdminPagePro from "./AdminPagePro";
import AdminLogin from "./AdminLogin";
import AboutPage from "./AboutPage";
import "./App.css"; // Ajoute du CSS moderne

import logo from "./assets/nasaflow-1.png";
import { FaInstagram, FaTiktok, FaFacebookF } from "react-icons/fa";

const socialLinks = [
  { href: "https://www.instagram.com/", icon: <FaInstagram size={24} />, alt: "Instagram" },
  { href: "https://www.tiktok.com/", icon: <FaTiktok size={24} />, alt: "TikTok" },
  { href: "https://www.facebook.com/", icon: <FaFacebookF size={24} />, alt: "Facebook" },
];

function App() {
  const { cart } = useCart();
  const totalItems = cart.reduce((sum, item) => sum + item.quantity, 0);

  return (
    <>
      {/* Navbar */}
      <header className="navbar">
        <Link to="/" className="logo">
            <img src={logo} alt="Logo NasaFlow" className="logo-img"
            style={{ height: 44, marginRight: 16, verticalAlign: "middle" }}
/>
          <span style={{ fontWeight: "bold", fontSize: 22, letterSpacing: 2 }}>
            NasaFlow
          </span>
        </Link>
        <nav>
          <Link to="/a-propos" className="nav-link">
            À propos
          </Link>
          <Link to="/panier" className="cart-button">
            🛒 Panier
            {totalItems > 0 && <span className="cart-badge">{totalItems}</span>}
          </Link>
        </nav>
        <div className="socials">
          {socialLinks.map(({ href, icon, alt }) => (
            <a key={href} href={href} target="_blank" rel="noopener noreferrer" className="social-link">
              {icon}
            </a>
          ))}
        </div>
      </header>

      {/* Hero Section animée */}
      <section className="hero-banner">
        <div className="hero-content">
          <h1 className="hero-title">Découvrez la révolution du souffle !</h1>
          <p className="hero-sub">
            Boostez votre respiration et vos performances avec <b>NasaFlow</b>.
            <br />Essayez la bandelette magnétique #1 en Suisse pour le sport & le bien-être.
          </p>
          <Link to="/panier" className="hero-cta">
            Je veux respirer mieux →
          </Link>
        </div>
        {/* Carousel d'images animées */}
        <div className="hero-carousel">
          <img src="/nasaflow-box.png" alt="Bandelette NasaFlow" className="carousel-img slide1" />
          <img src="/product2.png" alt="Bandelette en situation" className="carousel-img slide2" />
          <img src="/product3.png" alt="Vue rapprochée" className="carousel-img slide3" />
        </div>
      </section>

      {/* Routes */}
      <Routes>
        <Route path="/" element={<NasaFlowShop />} />
        <Route path="/panier" element={<CartPage />} />
        <Route path="/success" element={<SuccessPage />} />
        <Route path="/admin" element={<AdminPage />} />
        <Route path="/admin-pro" element={<AdminPagePro />} />
        <Route path="/admin-login" element={<AdminLogin />} />
        <Route path="/a-propos" element={<AboutPage />} />
      </Routes>
    </>
  );
}

export default App;
